const t="buy now";
const l ="./cpu.jpg";
function Card (props) {

    return(
<div className=" max-w-xs  px-2 py-2 bg-white-500 border-2 border-solid  transition-all duration-150 hover:scale-105 hover:shadow-lg hover:shadow-slate-600 rounded-lg " >
<img className=" py-2 relative left-14 rounded-3xl max-w-36" src={props.s.image+props.s.category+props.s.name} ></img>

<h1 className="font-extrabold text-xl font-integral">&gt;{props.s.name}
</h1>
<div className="font-integral text-xs">{props.s.category}</div>
<div className="flex py-2 justify-around">
<Button name={t}/>
<Button fn={props.fn} name="Add to cart"/>
</div>
</div>
    
    )
}

export default Card;
